import React from 'react'
import { Link } from 'react-router-dom';
import './Pin.css';

const Pin = ({ data }) => {
  return (
    <div className="gallery">
      {data.map(item => (
          <img src={item.name} alt={`Image ${item.name}`} />
      ))}
    </div>
  );
};




export default Pin;
